import React, { useEffect, useState } from "react";
import Myheader from "./header";
import { Link } from "react-router-dom";

const MyResume = () => {
  let [pdata, updatPdata] = useState([]);
  let [ctcdata, updatCtcdata] = useState([]);
  let [edudata, updatEdudata] = useState([]);
  let [skldata, updatSkldata] = useState([]);
  const getPersonalData = () => {
    var url1 = "http://localhost:1240/personal";

    fetch(url1)
      .then((response) => response.json())
      .then((arrayPdada) => {
        updatPdata(arrayPdada);
      });
  };
  const getContactData = () => {
    var url2 = "http://localhost:1240/contact";

    fetch(url2)
      .then((response) => response.json())
      .then((arrayPdada) => {
        updatCtcdata(arrayPdada);
      });
  };
  const getEducationData = () => {
    var url3 = "http://localhost:1240/education";

    fetch(url3)
      .then((response) => response.json())
      .then((arrayPdada) => {
        updatEdudata(arrayPdada);
      });
  };
  const getSkillData = () => {
    var url4 = "http://localhost:1240/skills";

    fetch(url4)
      .then((response) => response.json())
      .then((arrayPdada) => {
        updatSkldata(arrayPdada);
      });
  };
  useEffect(() => {
    getPersonalData();
    getContactData();
    getEducationData();
    getSkillData();
    console.log(pdata[1]);
  }, [1]);
  return (
    <div className="container mt-4 p-4 rounded">
      <div className="row mt-5">
        <div className="col-lg-12">
          <h2 className="text-center text-info">My</h2>
        </div>
      </div>
      <div className="col-lg-9 p-4 bg-white pt-4 shadow-lg">
        <div className="row">
          <div className="col-lg-12">
            {pdata.map((pinfo, index) => {
              return (
                <div key={index} className="">
                  <label>
                    Full Name : <b>{pinfo.fullname}</b>
                  </label>

                  <label>
                    Mobile No : <b></b>
                  </label>

                  <label>
                    e-Mail Id : <b></b>
                  </label>
                </div>
              );
            })}
          </div>
        </div>
      </div>
    </div>
  );
};

export default MyResume;
